import React from "react";
import { Link } from "react-router-dom";

const PageOne = () => {
  return (
    <>
      <h1>This is PageOne</h1>

      <ul>
        <li>
          <Link to="/page-one/a">Details of A</Link>
        </li>
        <li>
          <Link to="/page-one/b">Details of B</Link>
        </li>
        <li>
          <Link to="/page-one/c">Details of C</Link>
        </li>
      </ul>
    </>
  );
};

export default PageOne;
